import React from 'react';
import info from '../info.svg'

function App() {
  return (
    <div className='infoChat'>
        <img src={info} className="infoChat_bg" alt="Info Icon" />
        <img src={info} className="" alt="Info Icon" />
    </div>
  );
}

export default App;
